//! SCB Application Interrupt and Reset Control Register Definitions \n
//! SCB AIRCR: VECTKEY Position
#define IRQ_SCB_AIRCR_VECTKEY_POS                          (16U)

//! SCB AIRCR: VECTKEY Mask
#define IRQ_SCB_AIRCR_VECTKEY_Msk                          (0xFFFFUL << IRQ_SCB_AIRCR_VECTKEY_POS)

//! Register key
#define IRQ_SCB_AIRCR_VECTKEY                              (0x5FAUL)

//! Get ISER item
#define IRQ_ISER_ITEM(nIrqNumber)                          ((nIrqNumber) >> 5UL)

//! Threshold mask to get first five bits
#define IRQ_THRESHOLD_MASK                                 (0x1FUL)

//! SCB AIRCR: PRIGROUP Position
#define IRQ_SCB_AIRCR_PRIGROUP_POS                         (8U)

//! SCB AIRCR: PRIGROUP Mask
#define IRQ_SCB_AIRCR_PRIGROUP_MSK                         (7UL << IRQ_SCB_AIRCR_PRIGROUP_POS)

//! Maximum number of peripheral interrupts
#define IRQ_MAX_QTY_PERIPHERAL_INTERRUPTS                  (480U)

