#elif (IRQ_QTY_GROUP_PRIORITIES == 2U)
    #define IRQ_CODE_PRIGROUP_BITS                         (6U)
#elif (IRQ_QTY_GROUP_PRIORITIES == 4U)
    #define IRQ_CODE_PRIGROUP_BITS                         (5U)
#elif (IRQ_QTY_GROUP_PRIORITIES == 8U)
    #define IRQ_CODE_PRIGROUP_BITS                         (4U)
#elif (IRQ_QTY_GROUP_PRIORITIES == 16U)
    #define IRQ_CODE_PRIGROUP_BITS                         (3U)
#elif (IRQ_QTY_GROUP_PRIORITIES == 32U)
    #define IRQ_CODE_PRIGROUP_BITS                         (2U)
#elif (IRQ_QTY_GROUP_PRIORITIES == 64U)
    #define IRQ_CODE_PRIGROUP_BITS                         (1U)
#elif (IRQ_QTY_GROUP_PRIORITIES == 128U)
    #define IRQ_CODE_PRIGROUP_BITS                         (0U)
