//**************************************************************************************************
//! Initialize group priority and sub-priority levels for system and peripheral interrupts, \n
//! enabled interrupts
//!
//! \note None
//!
//! \param None
//!
//! \return None
//**************************************************************************************************
void IRQ_Init(void)
{
    // Set Priority Grouping
    U32 nReg = SCB.AIRCR.R;

    // Clear PRIGROUP bits and register key
    nReg &= ~((U32)(IRQ_SCB_AIRCR_VECTKEY_Msk | IRQ_SCB_AIRCR_PRIGROUP_MSK));

    // Set PRIGROUP bits
    nReg |= ((U32)IRQ_SCB_AIRCR_VECTKEY << IRQ_SCB_AIRCR_VECTKEY_POS) |
           ((U32)IRQ_CODE_PRIGROUP_BITS << IRQ_SCB_AIRCR_PRIGROUP_POS);

    SCB.AIRCR.R = nReg;

    // Setting system interrupts
    // Set group priority level for the MemManage
    SCB.SHPR1.B.PRI_4 = (U8)((IRQ_SYS_HANDLER_MEM_MANAGE_GROUP_PRIORITY_LEVEL << \
                             (IRQ_CODE_PRIGROUP_BITS + 1U)) & (U8)U8_MAX_VALUE);

    // Set group priority level for the BusFault
    SCB.SHPR1.B.PRI_5 = (U8)((IRQ_SYS_HANDLER_BUS_FAULT_GROUP_PRIORITY_LEVEL << \
                             (IRQ_CODE_PRIGROUP_BITS + 1U)) & (U8)U8_MAX_VALUE);

    // Set group priority level for the UsageFault
    SCB.SHPR1.B.PRI_6 = (U8)((IRQ_SYS_HANDLER_USAGE_FAULT_GROUP_PRIORITY_LEVEL << \
                             (IRQ_CODE_PRIGROUP_BITS + 1U)) & (U8)U8_MAX_VALUE);

    // Set group priority level for the SVCall
    SCB.SHPR2.B.PRI_11 = (U8)((IRQ_SYS_HANDLER_SV_CALL_GROUP_PRIORITY_LEVEL << \
                              (IRQ_CODE_PRIGROUP_BITS + 1U)) & (U8)U8_MAX_VALUE);

    // Set group priority level for the PendSV
    SCB.SHPR3.B.PRI_14 = (U8)((IRQ_SYS_HANDLER_PEND_SV_GROUP_PRIORITY_LEVEL << \
                              (IRQ_CODE_PRIGROUP_BITS + 1U)) & (U8)U8_MAX_VALUE);

    // Set group priority level for the SysTick
    SCB.SHPR3.B.PRI_15 = (U8)((IRQ_SYS_HANDLER_SYSTICK_GROUP_PRIORITY_LEVEL << \
                              (IRQ_CODE_PRIGROUP_BITS + 1U)) & (U8)U8_MAX_VALUE);

    // Set SUB priority level for the MemManage
    SCB.SHPR1.B.PRI_4 |= (U8)((IRQ_SYS_HANDLER_MEM_MANAGE_SUB_PRIORITY_LEVEL << \
                              (U8_BIT_QTY - IRQ_TOTAL_QTY_PRIORITY_BITS)) & (U8)U8_MAX_VALUE);

    // Set group priority level for the BusFault
    SCB.SHPR1.B.PRI_5 |= (U8)((IRQ_SYS_HANDLER_BUS_FAULT_SUB_PRIORITY_LEVEL << \
                              (U8_BIT_QTY - IRQ_TOTAL_QTY_PRIORITY_BITS)) & (U8)U8_MAX_VALUE);

    // Set group priority level for the UsageFault
    SCB.SHPR1.B.PRI_6 |= (U8)((IRQ_SYS_HANDLER_USAGE_FAULT_SUB_PRIORITY_LEVEL << \
                              (U8_BIT_QTY - IRQ_TOTAL_QTY_PRIORITY_BITS)) & (U8)U8_MAX_VALUE);

    // Set group priority level for the SVCall
    SCB.SHPR2.B.PRI_11 |= (U8)((IRQ_SYS_HANDLER_SV_CALL_SUB_PRIORITY_LEVEL << \
                               (U8_BIT_QTY - IRQ_TOTAL_QTY_PRIORITY_BITS)) & (U8)U8_MAX_VALUE);

    // Set group priority level for the PendSV
    SCB.SHPR3.B.PRI_14 |= (U8)((IRQ_SYS_HANDLER_PEND_SV_SUB_PRIORITY_LEVEL << \
                               (U8_BIT_QTY - IRQ_TOTAL_QTY_PRIORITY_BITS)) & (U8)U8_MAX_VALUE);

    // Set group priority level for the SysTick
    SCB.SHPR3.B.PRI_15 |= (U8)((IRQ_SYS_HANDLER_SYSTICK_SUB_PRIORITY_LEVEL << \
                               (U8_BIT_QTY - IRQ_TOTAL_QTY_PRIORITY_BITS)) & (U8)U8_MAX_VALUE);

// Enable MemManage interrupt
#if (ON == IRQ_SYS_HANDLER_MEM_MANAGE_ENABLE)
    SCB.SHCSR.B.MEMFAULTENA = ON;
#endif

// Enable BusFault interrupt
#if (ON == IRQ_SYS_HANDLER_BUS_FAULT_ENABLE)
    SCB.SHCSR.B.BUSFAULTENA = ON;
#endif

// Enable UsageFault interrupt
#if (ON == IRQ_SYS_HANDLER_USAGE_FAULT_ENABLE)
    SCB.SHCSR.B.USGFAULTENA = ON;
#endif

// Enable SysTick interrupt
#if (ON == IRQ_SYS_HANDLER_SYSTICK_ENABLE)
    STK.CTRL.B.TICKINT = ON;
#endif


    // Setting interrupts
    for (U32 nIrqNumber = 0U; nIrqNumber < IRQ_MAX_QTY_PERIPHERAL_INTERRUPTS; nIrqNumber++)
    {
        // Set group priority level
        NVIC.IPR[nIrqNumber] = (U8)((IRQ_aSettings[nIrqNumber].nGroupPriority << \
                                   (IRQ_CODE_PRIGROUP_BITS + 1U)) & (U8)U8_MAX_VALUE);

        // Set sub-priority level
        NVIC.IPR[nIrqNumber] |= (U8)((IRQ_aSettings[nIrqNumber].nSubPriority << \
                                    (U8_BIT_QTY - IRQ_TOTAL_QTY_PRIORITY_BITS)) & (U8)U8_MAX_VALUE);

        // Enable interrupt
        if (ON == IRQ_aSettings[nIrqNumber].bEnable)
        {
            NVIC.ISER[IRQ_ISER_ITEM(nIrqNumber)].R = 1UL << (nIrqNumber & IRQ_THRESHOLD_MASK);
        }
    }

    // Set vector table
    SCB.VTOR.R = (U32)IRQ_VECTOR_TABLE_LOCATION;
} // end of IRQ_Init()



